			},
			["displayText_format_p_time_dynamic_threshold"] = 60,
			["customText"] = "function()\n    local ae = aura_env\n    local dmg = ae.state.dmg or 0\n    local crt = ae.state.crt or 0\n    local dmg_a = ae.state.dmg_a or 0\n    local crt_a = ae.state.crt_a or 0\n    local dmg_clr = dmg > 0 and \"00FF00\" or \"FF0000\"\n    local crt_clr = crt > 0 and \"00FF00\" or \"FF0000\"\n    \n    if ae.config.applied then\n        return string.format(\"DMG: |cff%s%.2f%%|r (%.2f%%)\\nCRT: |cff%s%.2f%%|r (%.2f%%)\", dmg_clr, dmg, dmg_a, crt_clr, crt, crt_a)\n    else\n        return string.format(\"DMG: |cff%s%.2f%%|r\\nCRT: |cff%s%.2f%%|r\", dmg_clr, dmg, crt_clr, crt)\n    end\nend",
			["shadowYOffset"] = 0,
			["anchorPoint"] = "CENTER",
			["displayText_format_p_time_format"] = 0,
			["customTextUpdate"] = "event",
			["displayText_format_crt_format"] = "Number",
			["actions"] = {
				["start"] = {
				},
				["init"] = {
					["custom"] = "local ae = aura_env\nae.pguid = UnitGUID(\"player\")\nae.t9, ae.t10, ae.tal1, ae.tal2 = 0, 0, 0, 0\n--init global_state\nae.ids_t9 = {\n    -- alliance\n    47789, 47778, 47784, -- head\n    47792, 47781, 47787, -- shoulders\n    47791, 47779, 47786, -- chest\n    47788, 47782, 47783, -- gloves\n    47790, 47780, 47785, -- legs\n    -- Horde\n    47796, 47804, 47801, -- head\n    47793, 47807, 47798, -- shoulders\n    47794, 47806, 47799, -- chest\n    47797, 47803, 47802, -- gloves\n    47795, 47805, 47800, -- legs\n}\nae.ids_t10 = {\n    50241, 51208, 51231, -- head\n    50244, 51205, 51234, -- shoulders\n    50243, 51206, 51233, -- chest\n    50240, 51209, 51230, -- gloves\n    50242, 51207, 51232, -- legs\n}\n\nae.cs = function() -- check item sets\n    ae.t9, ae.t10 = 0, 0\n    \n    for _,v in pairs(ae.ids_t9) do\n        if IsEquippedItem(v) then\n            ae.t9 = ae.t9 + 1\n        end\n    end\n    \n    for _,v in pairs(ae.ids_t10) do\n        if IsEquippedItem(v) then\n            ae.t10 = ae.t10 + 1\n        end\n    end\nend\nae.cs()\n\nae.ct = function() -- check talents\n    ae.tal1 = select(5, GetTalentInfo(1, 21, false, false, nil)) * 3 or 0\n    ae.tal2 = select(5, GetTalentInfo(1, 23, false, false, nil)) * 4 or 0\nend\nae.ct()\n\nfunction nbOfAura(aura_to_search,unitId,filter)\n    local nb_aura_found = 0\n    for i = 1, 40 do\n        \n        spellName, _, stack, _, _, _, _, _, _, spellID = UnitAura(unitId, i, filter)\n        --print(dumpvar(UnitAura(unitId, i, filter)))\n        if not spellName then\n            -- nothing, gtfo\n            break\n        else\n            if spellName == aura_to_search then\n                if (stack ~= 0) then\n                    nb_aura_found = nb_aura_found + stack\n                else\n                    nb_aura_found = nb_aura_found + 1\n                end\n                \n            end\n        end\n        \n    end\n    return nb_aura_found\nend\n\n\nae.manage = function(allstates, event, new_corruption)\n    local t9 = ae.t9 >= 4 and 10 or 0\n    local t10 = ae.t10 >= 2 and 5 or 0\n    local unit = ae.config.test and \"target\" or \"boss1\"\n    local name = UnitName(unit)\n    local hpd = UnitHealth(unit) / UnitHealthMax(unit) < 0.35 and ae.tal2 or 0\n    \n    \n    \n    local dmg_amp_count = 0\n    local crit_amp_count = 0\n    ---CHECKING TRACKED BUFF\n    for k,v in pairs(aura_env.config.player_tracked_buff) do \n        if(v.player_tracked_buff_cumulative) then\n            local found_aura = nbOfAura(v.player_tracked_buff_name, \"player\", \"HELPFUL\")\n            if(found_aura > 0) then \n                if(v.player_tracked_buff_percent ~= 0) then\n                    dmg_amp_count = dmg_amp_count + (v.player_tracked_buff_percent) * found_aura\n                end\n                if(v.player_tracked_buff_crit ~= 0) then\n                    crit_amp_count = crit_amp_count + (v.player_tracked_buff_crit) * found_aura\n                end\n                \n            end\n        else\n            if(v.player_tracked_buff_percent ~= 0) then\n                dmg_amp_count = dmg_amp_count + (AuraUtil.FindAuraByName(v.player_tracked_buff_name, \"player\", \"HELPFUL\") and v.player_tracked_buff_percent or 0)\n            end\n            if(v.player_tracked_buff_crit ~= 0) then\n                crit_amp_count = crit_amp_count + (AuraUtil.FindAuraByName(v.player_tracked_buff_name, \"player\", \"HELPFUL\") and v.player_tracked_buff_crit or 0)\n            end\n        end\n    end\n    ---CHECKING PLAYER TRACKED DEBUFF\n    for k,v in pairs(aura_env.config.player_tracked_debuff) do \n        if(v.player_tracked_debuff_cumulative) then\n            local found_aura = nbOfAura(v.player_tracked_debuff_name, \"player\", \"HARMFUL\")\n            if(found_aura > 0) then \n                if(v.player_tracked_debuff_percent ~= 0) then\n                    dmg_amp_count = dmg_amp_count + (v.player_tracked_debuff_percent) * found_aura\n                end\n                if(v.player_tracked_debuff_crit ~= 0) then\n                    crit_amp_count = crit_amp_count + (v.player_tracked_debuff_crit) * found_aura\n                end\n                \n            end\n            \n        else\n            if(v.player_tracked_debuff_percent ~= 0) then\n                dmg_amp_count = dmg_amp_count + (AuraUtil.FindAuraByName(v.player_tracked_debuff_name, \"player\", \"HARMFUL\") and v.player_tracked_debuff_percent or 0)\n            end\n            if(v.player_tracked_debuff_crit ~= 0) then\n                crit_amp_count = crit_amp_count + (AuraUtil.FindAuraByName(v.player_tracked_debuff_name, \"player\", \"HARMFUL\") and v.player_tracked_debuff_crit or 0)\n            end\n        end\n    end\n    ---CHECKING Target TRACKED DEBUFF\n    for k,v in pairs(aura_env.config.target_tracked_debuff) do \n        if(v.target_tracked_debuff_cumulative) then\n            local found_aura = nbOfAura(v.target_tracked_debuff_name, unit, \"HARMFUL\")\n            if(found_aura > 0) then \n                if(v.target_tracked_debuff_percent ~= 0) then\n                    dmg_amp_count = dmg_amp_count + (v.target_tracked_debuff_percent) * found_aura\n                end\n                if(v.target_tracked_debuff_crit ~= 0) then\n                    crit_amp_count = crit_amp_count + (v.target_tracked_debuff_crit) * found_aura\n                end\n                \n            end\n            \n        else\n            if(v.target_tracked_debuff_percent ~= 0) then\n                dmg_amp_count = dmg_amp_count + (AuraUtil.FindAuraByName(v.target_tracked_debuff_name, unit, \"HARMFUL\") and v.target_tracked_debuff_percent or 0)\n            end\n            if(v.target_tracked_debuff_crit ~= 0) then\n                crit_amp_count = crit_amp_count + (AuraUtil.FindAuraByName(v.target_tracked_debuff_name, unit, \"HARMFUL\") and v.target_tracked_debuff_crit or 0)\n            end\n        end\n    end\n    local dmg = t9 + hpd + dmg_amp_count\n    local crt = t10 + ae.tal1 + GetSpellCritChance(6) + crit_amp_count\n    \n    \n    local state = allstates[\"roll\"]\n    \n    if new_corruption then\n        allstates[\"roll\"] = {\n            changed = true,\n            show = true,\n            name = name,\n            -- modified values\n            dmg = 0,\n            crt = 0,\n            -- applied values\n            dmg_a = dmg,\n            crt_a = crt,\n        }\n    end\n    if state then\n        if event == \"UNIT_AURA\"\n        or event == \"UNIT_COMBAT\"\n        or event == \"UNIT_STATS\"\n        or event == \"PLAYER_EQUIPMENT_CHANGED\" then\n            state.changed = true\n            state.dmg = dmg - state.dmg_a\n            state.crt = crt - state.crt_a\n        end\n    end\n    return allstates\nend",
