						["custom"] = "function(allstates, event, arg1, arg2,arg3, arg4,arg5, arg6,arg7, arg8,arg9, arg10,arg11, arg12,arg13,arg14)\n    local ae = aura_env\n    local unit = ae.config.test and \"target\" or \"boss1\"\n    \n    if event == \"PLAYER_ENTERING_WORLD\"\n    or event == \"PLAYER_EQUIPMENT_CHANGED\"\n    or event == \"ACTIVE_TALENT_GROUP_CHANGED\"\n    or event == \"PLAYER_TALENT_UPDATE\" then\n        ae.cs()\n        ae.ct()\n        \n    elseif event == \"PLAYER_EQUIPMENT_CHANGED\"\n    and arg1 >= 16 then\n        ae.cs()\n        ae.ct()\n        ae.manage(allstates,event,false)\n        \n    elseif event == \"UNIT_AURA\"\n    or event == \"UNIT_COMBAT\"\n    or event == \"UNIT_STATS\" then\n        ae.manage(allstates,event,false)\n        \n    elseif arg4 == ae.pguid\n    and arg8 == UnitGUID(unit)\n    and arg13 == \"Corruption\" then\n        if arg2 == \"SPELL_CAST_SUCCESS\" then\n            ae.manage(allstates,event, true)\n        elseif arg2 == \"SPELL_AURA_REMOVED\" then\n            if not (allstates[\"roll\"]  == null) then \n                allstates[\"roll\"].changed = true5\n                allstates[\"roll\"].show = false\n            end\n        end\n    elseif arg2 == \"UNIT_DIED\" and arg8 == UnitGUID(unit) then\n        if not (allstates[\"roll\"]  == null) then \n            allstates[\"roll\"].changed = true\n            allstates[\"roll\"].show = false\n        end\n        \n    end\n    return true\nend",
