					["custom"] = "aura_env.bottomId = \"33432\"\naura_env.bodyId = \"33651\"\naura_env.headId = \"33670\"\n\naura_env.bottomHP = 1\naura_env.bodyHP = 1\naura_env.headHP = 1\n\naura_env.bottomDead = false\naura_env.bodyDead = false\naura_env.headDead = false\n\naura_env.scanTargets = function()\n    aura_env.bottomFound = false\n    aura_env.bodyFound = false\n    aura_env.headFound = false\n    for unit in WA_IterateGroupMembers() do\n        local guid = UnitGUID(unit..\"target\")\n        if guid ~= nil then\n            local npcId = select(6, strsplit(\"-\", guid))\n            if npcId == aura_env.bottomId then\n                aura_env.bottomHP = UnitHealth(unit..\"target\") / UnitHealthMax(unit..\"target\")\n                if aura_env.headFound and aura_env.bodyFound then\n                    return true\n                else \n                    aura_env.bottomFound = true\n                end\n            elseif npcId == aura_env.headId then\n                aura_env.headHP = UnitHealth(unit..\"target\") / UnitHealthMax(unit..\"target\")\n                if aura_env.bottomFound and aura_env.bodyFound then\n                    return true\n                else \n                    aura_env.headFound = true\n                end\n            elseif npcId == aura_env.bodyId then\n                aura_env.bodyHP = UnitHealth(unit..\"target\") / UnitHealthMax(unit..\"target\")\n                if aura_env.bottomFound and aura_env.headFound then\n                    return true\n                else \n                    aura_env.bodyFound = true\n                end\n            end\n        end\n    end\nend",
					["do_custom"] = true,
				},
			},
