					["custom"] = "aura_env.corruption = GetSpellInfo(172)\naura_env.ds = GetSpellInfo(47855)\naura_env.dl = GetSpellInfo(47857)\naura_env.haunt = GetSpellInfo(59164)\naura_env.sb = GetSpellInfo(47809)\naura_env.mutilators = {}\naura_env.total = {}\naura_env.spellPower = {}\naura_env.text = 1",
