			["fixedWidth"] = 200,
			["displayText_format_c4_decimal_precision"] = 2,
			["wagoID"] = "5GWfkcgv3",
			["parent"] = "Fojji - Corruption Snapshotter",
			["customText"] = "function()\n    if not aura_env.last or aura_env.last < GetTime() - .1 then\n        aura_env.last = GetTime()\n        \n        -- Check Target\n        local targetGuid = UnitGUID(\"target\")\n        \n        -- Check Spellpower\n        local spellpowercurrent = GetSpellBonusDamage(6)\n        if (aura_env.spellPower[targetGuid] or 1) > spellpowercurrent then\n            aura_env.text = string.format(\"\\124cffFF0000-SP\\124r\")\n            return aura_env.text\n        end\n        \n        -- Check Spell Crit%\n        local critcurrent = GetSpellCritChance(6)\n        \n        -- Check Target Debuffs\n        for i = 1, 60 do\n            local _,_, count,_,_,_,sourceUnit,_,_,spellId = UnitDebuff(\"target\", i)\n            if not spellId then break end\n            if spellId == 22959 or spellId == 17800 then -- Shadow Mastery/Improved Scorch\n                critcurrent = critcurrent + 5\n            end\n            if spellId == 54499 then -- Heart of the Crusader\n                critcurrent = critcurrent + 3\n            end\n            if spellId == 57970 then\n                local sourceGuid = UnitGUID(sourceUnit)\n                if GetTime() < (aura_env.mutilators[sourceGuid] or 0) then\n                    critcurrent = critcurrent + 3\n                end\n            end\n        end\n        \n        -- Check Damage Modifier%\n        local _, _,_,_,_,_,varmodcurrent = UnitDamage(\"player\")\n        local modcurrent = varmodcurrent\n        local maxHP = UnitHealthMax(\"target\")\n        local curHP = UnitHealth(\"target\")\n        local perHP = curHP * 100 / maxHP\n        if perHP <= 35 then\n            modcurrent = modcurrent + 0.12 -- Death's Embrace Talent\n        end\n        \n        -- Magic Formula\n        local totalcurrent = (((100* (modcurrent))*(100-critcurrent)/100)+((100* (modcurrent)*2)*(critcurrent)/100))\n        \n        local totaldifference = totalcurrent - (aura_env.total[targetGuid] or 1)\n        aura_env.text = \"\"\n        if totaldifference ~= 0.0 then\n            aura_env.text = string.format(\"|cFF%s%s%.1f%%|r\", totaldifference > 0 and '22ff43' or totaldifference < 0 and 'ff2f2a' or '808080', totaldifference > 0 and '+' or '', totaldifference)\n        end\n        return aura_env.text\n    end\n    return aura_env.text\nend",
			["displayText_format_c2_decimal_precision"] = 2,
			["cooldownSwipe"] = true,
			["customTextUpdate"] = "update",
			["automaticWidth"] = "Auto",
			["triggers"] = {
