						["event"] = "Combat Log",
						["use_spellName"] = true,
						["spellIds"] = {
						},
						["use_spellId"] = false,
						["custom"] = "function(event, _, subevent, _, _, sourceName, _, _, destGUID, destName, _, _, spellId, spellName)\n    \n    \n    -- Store Values on Corruption Cast\n    if (subevent == \"SPELL_AURA_APPLIED\" or subevent == \"SPELL_AURA_REFRESH\") and spellName == aura_env.corruption and sourceName == UnitName(\"player\") then\n        local crit = GetSpellCritChance(6) -- Spell Crit of Shadow School\n        aura_env.spellPower[destGUID] = GetSpellBonusDamage(6) -- Spell Power at time of Application\n        \n        \n        -- Check Debuffs on Target\n        for i = 1, 60 do\n            local _,_, count,_,_,_,sourceUnit,_,_,spellId = UnitDebuff(\"target\", i)\n            if not spellId then break end\n            if spellId == 22959 or spellId == 17800 then -- Shadow Mastery/Improved Scorch\n                crit = crit + 5\n            end\n            if spellId == 54499 then -- Heart of the Crusader\n                crit = crit + 3\n            end\n            \n            if spellId == 57970 then\n                local sourceGuid = UnitGUID(sourceUnit)\n                if GetTime() < (aura_env.mutilators[sourceGuid] or 0) then\n                    crit = crit + 3\n                end\n            end\n        end\n        \n        \n        -- Check Players Damage Modifier\n        local _, _,_,_,_,_,varmodapplied = UnitDamage(\"player\")\n        local mod = varmodapplied\n        local maxHP = UnitHealthMax(\"target\")\n        local curHP = UnitHealth(\"target\")\n        local perHP = curHP * 100 / maxHP\n        if perHP <= 35 then mod = mod + 0.12 -- Death's Embrace Talent\n        end\n        \n        aura_env.total[destGUID] = (((100*(mod))*(100-crit)/100)+((100*(mod)*2)*(crit)/100))\n        return true\n    end\n    if subevent == \"SPELL_DAMAGE\" and spellName == aura_env.sb and sourceName == UnitName(\"player\") then\n        aura_env.spellPower[destGUID] = GetSpellBonusDamage(6) -- Spell Power at time of Application\n    end\n    if subevent == \"SPELL_CAST_SUCCESS\" and spellName == (aura_env.haunt or aura_env.ds or aura_env.dl) and sourceName == UnitName(\"player\") then\n        aura_env.spellPower[destGUID] = GetSpellBonusDamage(6)\n    end\nend",
