,\n        enabled = aura_env.config.track[20],\n        icon = 134336,\n        level = 18,\n        name = \"Soulstone Resurrection\",\n    },\n    [21] = {\n        cd = 300,\n        class = \"Warrior\",\n        enabled = aura_env.config.track[21],\n        icon = 311430,\n        level = 71,\n        name = \"Shattering Throw\",\n    },\n}\n\naura_env.savedDuration = {}\naura_env.savedExpiration = {}\n\nfunction aura_env:IsUnitValid(unit, enabled, spec)\n    local isValid = isValid or false\n    if unit and enabled == true then\n        local specID = Details:GetSpecByGUID(UnitGUID(unit))\n        if spec then\n            if spec == specID then\n                isValid = true\n            end\n        elseif spec == nil then\n            isValid = true\n        end\n        return isValid\n    end\nend",
