						["custom"] = "function (allstates, event, ...)\n    if event == \"GROUP_ROSTER_UPDATE\" or event == \"PLAYER_ENTERING_WORLD\" then\n        for _, state in pairs(allstates) do\n            state.show = false\n            state.changed = true\n        end\n        for unit in WA_IterateGroupMembers() do\n            local unitName = UnitName(unit)\n            local class = UnitClass(unit)\n            local level = UnitLevel(unit)\n            for _, v in ipairs(aura_env.spells) do\n                --print(v.name, aura_env:CheckSpec(v.spec, unit), unitName)\n                if (aura_env:IsUnitValid(unit, v.enabled, v.spec) == true) and (class == v.class and level >= v.level and UnitIsConnected(unit) == true) then\n                    allstates[unitName .. v.name] = {\n                        show = true,\n                        changed = true,\n                        progressType = \"timed\",\n                        duration = aura_env.savedDuration[unitName .. v.name] or 0,\n                        expirationTime = aura_env.savedExpiration[unitName .. v.name] or 0,\n                        name = unitName,\n                        icon = v.icon,\n                        index = v.name,\n                        rdyTimer = aura_env.savedExpiration[unitName .. v.name] or 0,\n                    }\n                end\n            end\n        end\n    end\n    if event == \"ENCOUNTER_END\" then\n        for unit in WA_IterateGroupMembers() do\n            local unitName = UnitName(unit)\n            local class = UnitClass(unit)\n            local level = UnitLevel(unit)\n            for _, v in ipairs(aura_env.spells) do\n                --print(v.name, aura_env:CheckSpec(v.spec, unit), unitName)\n                if (aura_env:IsUnitValid(unit, v.enabled, v.spec) == true) and (class == v.class and level >= v.level and UnitIsConnected(unit) == true) then\n                    allstates[unitName .. v.name] = {\n                        show = true,\n                        changed = true,\n                        progressType = \"timed\",\n                        duration = 0,\n                        expirationTime = 0,\n                        name = unitName,\n                        icon = v.icon,\n                        index = v.name,\n                        rdyTimer = 0,\n                    }\n                end\n            end\n        end\n    end\n    if IsInGroup() == true then\n        local _, subEvent, _, guid, sourceName, _, _, destGUID, destName, _, _, spellId, spellName, missType = ...\n        if subEvent == \"SPELL_CAST_SUCCESS\" and allstates[sourceName .. spellName] ~= nil then\n            local timestamp = GetTime()\n            local class = UnitClass(sourceName)\n            for _, v in ipairs(aura_env.spells) do\n                if (spellName == v.name and v.enabled == true) then\n                    local nameString = sourceName\n                    if destName ~= nil then\n                        nameString = sourceName .. \" > \" .. destName\n                    end\n                    allstates[sourceName .. spellName] = {\n                        show = true,\n                        changed = true,\n                        progressType = \"timed\",\n                        duration = v.cd,\n                        expirationTime = timestamp + v.cd,\n                        name = nameString,\n                        icon = v.icon,\n                        index = v.name,\n                        rdyTimer = timestamp + v.cd,\n                    }\n                    aura_env.savedDuration[sourceName .. v.name] = allstates[sourceName .. v.name].duration\n                    aura_env.savedExpiration[sourceName .. v.name] = allstates[sourceName .. v.name].expirationTime\n                end\n            end\n        end\n    end\n    return true\nend",
