				["finish"] = {
				},
				["init"] = {
					["custom"] = "aura_env.ds = GetSpellInfo(47855)\naura_env.dsStart = 0\naura_env.delta = 0\naura_env.spProc = 0\n\naura_env.procTrinkets = {\n    [60494] = 765, -- Dying Curse\n    [60064] = 590, -- Sundial of the Exiled\n    [64713] = 959, -- Flare of the Heavens\n}\n\nfunction aura_env.calculateStore()\n    -- Spell Power at time of Application\n    aura_env.spellPowerStore = GetSpellBonusDamage(6)\n    aura_env.spellPowerTotal = aura_env.spellPowerStore - aura_env.spProc\n    \n    -- Check Players Damage Modifier\n    local _,_,_,_,_,_,varmodapplied = UnitDamage(\"player\")\n    local mod = varmodapplied\n    \n    -- Drain Soul Total Cast Time\n    local _,_,_,sbCastTime = GetSpellInfo(6215)\n    local dsChannel = (sbCastTime / 1000) * 10\n    \n    -- Spell Coefficients\n    local spellCoefficient = 0.429\n    local coefficientTotal = 2.145\n    \n    -- Total Spell Damage\n    local spellDamage = aura_env.spellPowerTotal * coefficientTotal\n    \n    -- Shadow Mastery Talent 15% Damage\n    local shadowMastery = 1.15\n    \n    -- Deaths Embrace Talent 12% Damage\n    local deathsEmbrace = 1.12\n    \n    -- Drain Soul 25% Modifier\n    local drainSoulModifier = 4\n    \n    -- Base Drain Soul Tick\n    local baseDS = 840\n    \n    -- DPS Formula\n    local snappedDamage = (baseDS + spellDamage) * shadowMastery * deathsEmbrace * drainSoulModifier * mod\n    \n    local total =  snappedDamage / dsChannel\n    return math.floor(total)\nend\n\nfunction aura_env.calculateLive()\n    -- Spell Power at time of Application\n    aura_env.spellPower = GetSpellBonusDamage(6)\n    \n    -- Check Players Damage Modifier\n    local _,_,_,_,_,_,varmodapplied = UnitDamage(\"player\")\n    local mod = varmodapplied\n    \n    -- Drain Soul Total Cast Time\n    local _,_,_,sbCastTime = GetSpellInfo(6215)\n    local dsChannel = (sbCastTime / 1000) * 10\n    \n    -- Spell Coefficients\n    local spellCoefficient = 0.429\n    local coefficientTotal = 2.145\n    \n    -- Total Spell Damage\n    local spellDamage = aura_env.spellPower * coefficientTotal\n    \n    -- Shadow Mastery Talent 15% Damage\n    local shadowMastery = 1.15\n    \n    -- Deaths Embrace Talent 12% Damage\n    local deathsEmbrace = 1.12\n    \n    -- Drain Soul 25% Modifier\n    local drainSoulModifier = 4\n    \n    -- Base Drain Soul Tick\n    local baseDS = 840\n    \n    -- DPS Formula\n    local snappedDamage = (baseDS + spellDamage) * shadowMastery * deathsEmbrace * drainSoulModifier * mod\n    \n    local total =  snappedDamage / dsChannel\n    return math.floor(total)\nend\n\nfunction aura_env.HauntCastTime()\n    local _,_,_,GCD = GetSpellInfo(6215)\n    if not GCD then GCD = 1.5 end\n    return GCD/1000\nend",
